import React from 'react';
import styled from 'styled-components';

const List = () => {
  return (
    <Wrapper>
      <div className='grade'></div>
      <div className='team'>
        <div className='team-title'>Bruiser Warrios</div>
        <div className='team-style'>Slow Roll</div>
      </div>
      <ul className='team-comps'>
        <li className='teammates'></li>
      </ul>
    </Wrapper>
  );
};

export default List;

const Wrapper = styled.div`
  display: flex;
`;
